  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Cape May NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Cape May NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, a summary of Refuge resources, and information
  on the management direction and implementation. Key planning issues include: managing
  habitat and wildlife populations, controlling invasive species, pesticides, hunting,
  fishing, and public use.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
